script: |
  super -f text -I q2789.spq | sort > q2789.out

inputs:
  - name: q2789.spq
    data: |
      SELECT - 27 * col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE ( - 16 * - - 50 * - 26 + col2 ) NOT BETWEEN - 99 * col0 + + col1 / - col2 AND - 17 AND ( NULL ) BETWEEN - 38 * - col0 AND col1 + - col2;
  - name: tab2

outputs:
  - name: q2789.out
    data: |
